function ExecFunction(func_key)
	OutputLogMessage("Executing Function: %s\n", func_key)
	if func_key == "hipfire_on" then
		HipfireOn()
	elseif func_key == "hipfire_off" then
		HipfireOff()
	elseif func_key == "activate_deactivate" then
		ActivateDeactivate()
	elseif func_key == "activate" then
		Activate()
	elseif func_key == "deactivate" then
		Deactivate()
	elseif func_key == "legit_unreal" then
		LegitUnreal()
	elseif func_key == "legit" then
		Legit()
	elseif func_key == "unreal" then
		Unreal()
	elseif func_key == "silencer_on" then
		SilencerOn()
	elseif func_key == "silencer_off" then
		SilencerOff()
	elseif func_key == "toggle_tryout" then
		ToggleTryout()
	end
end

