function GetFactor(zoom_factor_bare, hipfire)
	local zoom_factor = 1 / zoom_factor_bare
	--OutputLogMessage("zoom_factor: %f\n", zoom_factor)
	local fov = fov_base

	if not hipfire then
		if (#selected_attachments == 0 or ListContains(selected_attachments, "ironsight")) then
			fov = fov * zoom_factor
		end

		if (ListContains(selected_attachments, "holo")) then
			fov = fov * holo
		end

		if (ListContains(selected_attachments, "8x")) then
			fov = fov * eightex
		end
	end

	if hipfire then
		return (fov / 666.6666666666666666) * normal_sens
	else
		return (fov / 666.6666666666666666) * sens 
	end
	
end 

function GetAdjusts(legit_percentage_horizontal, legit_percentage_vertical)
	local x_adjust = 1
	local y_adjust = 1

	if (legit) then

		y_adjust = (100 - legit_percentage_vertical) / 100

		x_adjust = (100 - legit_percentage_horizontal) / 100
	
	end

	if (ListContains(selected_attachments, "silencer") or ListContains(selected_attachments, "8x")) then
		x_adjust = x_adjust * 0.8
		y_adjust = y_adjust * 0.8
	end

	return x_adjust, y_adjust
end

function AtomicSleep(millis)
    local endTime = GetRunningTime() + millis
    while GetRunningTime() < endTime do
    end
end

function TableLength(T)
  local count = 0
  for _ in pairs(T) do count = count + 1 end
  return count
end


function GetRecoilGraph(key)
	if tryout and key ~= "m2" then
		local tryout_graphs = recoil_graphs_tryout[key]
		local table_lenght = TableLength(tryout_graphs)
		local random_index = math.random(1, table_lenght)
		while(random_index == previous_random_index) do
			random_index = math.random(1, table_lenght)
		end
		previous_random_index = random_index
		--OutputLogMessage("table_lenght: %s, random_index: %s\n", tostring(table_lenght), tostring(random_index))
		return tryout_graphs[random_index]
	else
		return recoil_graphs_auto[key]
	end
end

function FullAutoRecoil(start_ms, option)
	--OutputLogMessage("FullAutoRecoil, hipfire: %s\n", tostring(hipfire))
	-- needed for calcing the diff to move
	local last_position = {0, 0}

	local recoil_graph = GetRecoilGraph(option[1])

	local x_adjust, y_adjust = GetAdjusts(option[4], option[5])

	local factor_gun = GetFactor(option[2], false)
	local factor_hip = GetFactor(option[2], true)
	
	-- pixel pool, the amount of non full pixels that are left over after using closest_int
	local x_px_pool = 0
	local y_px_pool = 0

	repeat
    	-- values work based on a recoil graph that contains the recoil 
    	-- for each millisecond	
		local passed_ms = GetRunningTime() - start_ms

		--OutputLogMessage("passed_ms: %d\n", passed_ms)

		local position = recoil_graph[passed_ms]
		if(position ~= nil and (IsMouseButtonPressed(3) or hipfire)) then
			local factor = 0	
			if (IsMouseButtonPressed(3)) then
				factor = factor_gun
			elseif(hipfire) then
				factor = factor_hip
			end

			local crouched = IsModifierPressed("ctrl") and option[3]

    		-- how much we should move raw
			local now_move_y = position[2] - last_position[2]

			-- calculate pixel to move
			local move_y_px = (now_move_y / factor) * y_adjust

			if crouched then
				move_y_px = move_y_px / 2
			end

			local y_px_leftovers = y_px_pool

			-- add left over pixel from previous iteration
			local move_y_px_w_leftovers = move_y_px + y_px_leftovers
	    		
			-- floor it 
			local move_y_px_floored = closest_int(move_y_px_w_leftovers)

			-- get left over pixel once again
			y_px_pool = move_y_px_w_leftovers - move_y_px_floored

			-- update the total that we moved
			last_position[2] = position[2]

			-- same for x
			local now_move_x = position[1] - last_position[1]

			local move_x_px = (now_move_x / factor) * x_adjust

			if crouched then
				move_x_px = move_x_px / 2
			end

			local x_px_leftovers = x_px_pool

			local move_x_px_w_leftovers = move_x_px + x_px_leftovers

			local move_x_px_floored = closest_int(move_x_px_w_leftovers)

			x_px_pool = move_x_px_w_leftovers - move_x_px_floored

			last_position[1] = position[1]

			-- adjust recoil
			MoveMouseRelative(-move_x_px_floored, -move_y_px_floored)

			--OutputLogMessage("passed_ms: %f\nMoveMouseRelative(%f, %f)\nfactor: %f\n", passed_ms, -move_x_px_floored, -move_y_px_floored, factor)
			--OutputLogMessage("now_move_y: %f\nmove_y_px: %f\nmove_y_px_w_leftovers: %f\nmove_y_px_floored: %f\ny_px_leftovers: %f\ny_px_pool: %f\n\n", passed_ms, -move_x_px_floored, -move_y_px_floored, factor, now_move_y, move_y_px, move_y_px_w_leftovers, move_y_px_floored, y_px_leftovers, y_px_pool)
			--OutputLogMessage("now_move_x: %f\nmove_x_px: %f\nmove_x_px_w_leftovers: %f\nmove_x_px_floored: %f\nx_px_leftovers: %f\nx_px_pool: %f\n\n", now_move_x, move_x_px, move_x_px_w_leftovers, move_x_px_floored, x_px_leftovers, x_px_pool)
		end

		if use_atomic_sleep then
			AtomicSleep(math.random(1,3))
		else
			Sleep(1)
		end
	until not IsMouseButtonPressed(1)
	
end

-- also activates the script
function ExecWeaponBind(v)
	activated = true
	selected_weapon = GetIndex(weapon_options , v)
	OutputLogMessage("set activated and the selected weapon %s\n", v)
end

function ExecAttachmentBind(v)
	table.insert(selected_attachments, v)
	OutputLogMessage("inserted attachment %s\n", v)
end

function GetIndex(values, key) 
	local index={}
	for k,v in pairs(values) do
	   index[v[1]]=k
	end
	return index[key]
end

function ExecuteBind(bindValue)
	if bindValue == nil then
		return
	end
	OutputLogMessage("bindValue: %s\n", bindValue)

	local split = {}
	for i in bindValue:gmatch("([^, ]+)") do
		split[#split + 1] = i
	end

	local attachments_not_cleared = true

	for i, v in ipairs(split) do
		if SetContains(recoil_graphs_auto, v) then
			ExecWeaponBind(v)
		elseif ListContains(attachment_options, v) then
			if attachments_not_cleared then
				--OutputLogMessage("cleared attachments\n")
				for k in pairs(selected_attachments) do
			    	selected_attachments[k] = nil
				end
				attachments_not_cleared = false
			end
			ExecAttachmentBind(v)
		elseif ListContains(available_function_keys, v) then
			ExecFunction(v)
		end
	end

	print_info()
end

function ListRemove(tab, val)
	for index, value in ipairs(tab) do
        if value == val then
            table.remove(tab, index)
        end
    end
end

function ListContains (tab, val)
    for index, value in ipairs(tab) do
        if value == val then
            return true
        end
    end

    return false
end

function SetContains(set, key)
    return set[key] ~= nil
end

